import React, { useState } from "react";
import Container from "react-bootstrap/Container";
import Navbar from "react-bootstrap/Navbar";
import { NavLink } from "react-router-dom";
import Button from "react-bootstrap/Button";
import { useContext } from "react";
import { Appcontext } from "../App";
import ReadbyDoctorId from "./Questions/Answers/MydoctorAnsws";
import ReadbyPatientId from "./Questions/MypatientQns";
import Form from "react-bootstrap/Form";
import Modal from "react-bootstrap/Modal";

function StackExchangeHome() {
  const { usertype } = useContext(Appcontext);
  const [show, setShow] = useState(false);

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);

  // Use the map function to iterate over the data and create components

  return (
    <>
      {[false].map((expand) => (
        <Navbar key={expand} expand={expand} className="bg-body-tertiary mb-3">
          <Container fluid>
            <Navbar.Brand
              href="#"
              style={{
                fontSize: "27px",
                fontWeight: "bold",
                textDecoration: "underline",
                fontFamily: "sans-serif",
              }}
            >
              StackExchange for Health and Medicine-
            </Navbar.Brand>
            <div style={{ display: "flex" }}>
              <NavLink>
                <Button
                  variant="secondary"
                  size="lg"
                  style={{ fontFamily: "sans-serif" }}
                >
                  Ask
                </Button>
              </NavLink>
              <NavLink>
                <Button
                  variant="secondary"
                  size="lg"
                  style={{ fontFamily: "sans-serif" }}
                  onClick={handleShow}
                >
                  Search/readbyTags
                </Button>
              </NavLink>
              <Modal show={show} onHide={handleClose}>
                <Modal.Header closeButton>
                  <Modal.Title>Modal heading</Modal.Title>
                </Modal.Header>
                <Modal.Body>
                  <Form>
                    <Form.Group
                      className="mb-3"
                      controlId="exampleForm.ControlInput1"
                    >
                      <Form.Label>Email address</Form.Label>
                      <Form.Control
                        type="email"
                        placeholder="name@example.com"
                        autoFocus
                      />
                    </Form.Group>
                    <Form.Group
                      className="mb-3"
                      controlId="exampleForm.ControlTextarea1"
                    >
                      <Form.Label>Example textarea</Form.Label>
                      <Form.Control as="textarea" rows={3} />
                    </Form.Group>
                  </Form>
                </Modal.Body>
                <Modal.Footer>
                  <Button variant="secondary" onClick={handleClose}>
                    Close
                  </Button>
                  <Button variant="secondary" onClick={handleClose}>
                    Submit
                  </Button>
                </Modal.Footer>
              </Modal>
            </div>
          </Container>
        </Navbar>
      ))}
      {usertype === "patient" ? <ReadbyPatientId /> : <ReadbyDoctorId />}
    </>
  );
}

export default StackExchangeHome;
